import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Watchlist from "./components/Watchlist";
import Header from './components/Header';

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/">
          <Watchlist />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
